//----------------------------------- Draw circle marker  ------------------------------------>
function drawCircle(covid){
    for (let index = 0; index < covid.length; index++) {
        //----------- calculate percentage of confirmed - deaths - recovered
        confirmedpercent.push(((covid[index].confirmed/totalConfirmed)*100).toFixed(3))
        deathpercent.push(((covid[index].deaths/totalDeaths)*100).toFixed(3))
        recoveredpercent.push(((covid[index].recovered/totalrRecovered)*100).toFixed(3))
        //----------- classify country by deaths
        if (covid[index].deaths >7071) {circleColor='rgba(179, 00, 00, 0.8)';}
        else if (covid[index].deaths <7071 && covid[index].deaths >1160) {circleColor='rgba(255, 00, 00, 0.8)'; }
        else if (covid[index].deaths <1160 && covid[index].deaths >121) {circleColor='rgba(255, 77, 77, 0.8)'; }
        else if (covid[index].deaths <121 && covid[index].deaths >6) {circleColor='rgba(255, 121, 121, 0.8)'; }
        else if (covid[index].deaths <6) {circleColor='rgba(255, 183, 183, 0.8)'; }
        //----------- draw circle marker
        let CircleMarker=L.circleMarker(covid[index].coordinates,{
            radius:15,
            stroke:false,
            fillColor: circleColor,
            fillOpacity:.8
        })

        //----------- add pop-up
         CircleMarker.bindPopup(
            `<table id="popupTable">
            <thead>
                <tr>
                <th bgcolor='#DCDCDC'>Property</th>
                <th bgcolor='#DCDCDC'>Value</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                <th>Country Name</th>
                <td>${ covid[index].country}</td>
                </tr>
                <tr>
                    <th bgcolor='#F2F2F2'>Confirmed</th>
                    <td bgcolor='#F2F2F2'>${covid[index].confirmed}</td>
                    
                </tr>
                <tr>
                    <th >Confirmed percent</th>
                    <td >${confirmedpercent[index]}%</td>
                </tr>
                <tr>
                    <th bgcolor='#F2F2F2'>Deaths</th>
                    <td bgcolor='#F2F2F2'>${covid[index].deaths}</td>

                </tr>
                <tr>
                    <th>deaths percent</th>
                    <td>${deathpercent[index]}%</td>
                </tr>
                <tr>
                    <th bgcolor='#F2F2F2'>Recovered</th>
                    <td bgcolor='#F2F2F2'>${covid[index].recovered}</td>
                </tr>
                <tr>
                    <th>Recovered percent</th>
                    <td>${recoveredpercent[index]}%</td>
                </tr>
            </tbody>
        </table>`
        )

        //----------- add Event
        CircleMarker.addEventListener("click",()=>{
            filterList(covid[index].id)
            showPopup(covid[index].id,covid[index].coordinates)  
        })
            CircleMarker.addTo(layerGroup)
    }
}

//----------------------------------- map event ------------------------------------>
mymap.addEventListener("click",()=>{
    queryChart = false;
    listFilter=false;
    switchClass();
    list();
    updateDoughnut(totalConfirmed,totalDeaths,totalrRecovered)
    mymap.flyTo([31,30],3);	
})
//----------------------------------- pop-up function ------------------------------->
function showPopup(index,coordinate) {
    L.popup()
    .setLatLng(coordinate)
    .setContent (`<table id="popupTable">
    <thead>
        <tr>
        <th bgcolor='#DCDCDC'>Property</th>
        <th bgcolor='#DCDCDC'>Value</th>
        </tr>
    </thead>
    <tbody>
        <tr>
        <th style="padding-right: 10px;">Country Name</th>
        <td>${ covid[index].country}</td>
        </tr>
        <tr>
            <th bgcolor='#F2F2F2'>Confirmed</th>
            <td bgcolor='#F2F2F2'>${covid[index].confirmed}</td>
            
        </tr>
        <tr>
            <th >Confirmed percent</th>
            <td >${confirmedpercent[index]}%</td>
        </tr>
        <tr>
            <th bgcolor='#F2F2F2'>Deaths</th>
            <td bgcolor='#F2F2F2'>${covid[index].deaths}</td>

         </tr>
        <tr>
            <th>deaths percent</th>
            <td>${deathpercent[index]}%</td>
        </tr>
        <tr>
            <th bgcolor='#F2F2F2'>Recovered</th>
            <td bgcolor='#F2F2F2'>${covid[index].recovered}</td>
        </tr>
        <tr>
            <th>Recovered percent</th>
            <td>${recoveredpercent[index]}%</td>
        </tr>
    </tbody>
  </table>`).openOn(mymap);
 
}

function hidePopup() {
    let popupopened = document.getElementsByClassName("leaflet-popup")
    try{
    popupopened[0].style.display = 'none'
    }catch(e){
        let a = e
    }

}

//------------------------------------------- Legend ---------------------------------------->
function Legend() {
    if (legendMap) {
        document.getElementById("legend").style.display='block'
        legendMap = false
    }else{
        document.getElementById("legend").style.display='none'
        legendMap = true  
    }
}
