function backupGet(params) {
    var alldata= params.locations
    totalConfirmed =params.latest.confirmed;
    totalDeaths = params.latest.deaths;
    totalrRecovered = params.latest.recovered;
    for (let index = 0; index < alldata.length; index++) {
        if (alldata[index].coordinates.latitude && alldata[index].coordinates.longitude) {
            covid.push({
            id:counter,
            country:alldata[index].country ,
            country_code:alldata[index].country_code ,
            country_population:alldata[index].country_population ,
            confirmed:alldata[index].latest.confirmed ,
            deaths:alldata[index].latest.deaths ,
            recovered:alldata[index].latest.recovered ,
            coordinates: [alldata[index].coordinates.latitude,alldata[index].coordinates.longitude],
            last_updated: alldata[index].last_updated
            })
            counter +=1
        }

    }
    list();
    drawCircle(covid);
    
    DoughnutChart(totalConfirmed,totalDeaths,totalrRecovered);
    veryHigh();
}

